package ba.unsa.etf.si;

import javafx.beans.property.SimpleDoubleProperty;
import javafx.beans.property.SimpleIntegerProperty;
import javafx.beans.property.SimpleStringProperty;
import javafx.embed.swing.SwingFXUtils;
import javafx.scene.image.Image;

import javax.imageio.ImageIO;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.util.Base64;

public class ProductModel implements  IKonverzija{

    private final SimpleIntegerProperty id;
    private final SimpleStringProperty  name , unit;
    private final SimpleDoubleProperty price, discount, quantity;
    private final Image image;

    public ProductModel (int id, String name, double price, String base64Image, String unit, double discount, double quantity) {
        this.id = new SimpleIntegerProperty(id);
        this.name = new SimpleStringProperty(name);
        this.price = new SimpleDoubleProperty(price);
        this.image = null;
        this.unit = new SimpleStringProperty(unit);
        this.discount = new SimpleDoubleProperty(discount);
        this.quantity = new SimpleDoubleProperty(quantity);
    }


    public ProductModel (int id, String name, double price, Image image, String unit, double discount, double quantity) {
        this.id = new SimpleIntegerProperty(id);
        this.name = new SimpleStringProperty(name);
        this.price = new SimpleDoubleProperty(price);
        this.image = image;
        this.unit = new SimpleStringProperty(unit);
        this.discount = new SimpleDoubleProperty(discount);
        this.quantity = new SimpleDoubleProperty(quantity);
    }

    public int getId() {
        return id.get();
    }

    public SimpleIntegerProperty idProperty() {
        return id;
    }

    public void setId(int id) {
        this.id.set(id);
    }

    public String getName() {
        return name.get();
    }

    public SimpleStringProperty nameProperty() {
        return name;
    }

    public void setName(String name) {
        this.name.set(name);
    }

    public String getUnit() {
        return unit.get();
    }

    public SimpleStringProperty unitProperty() {
        return unit;
    }

    public void setUnit(String unit) {
        this.unit.set(unit);
    }

    public double getPrice() {
        return price.get();
    }

    public SimpleDoubleProperty priceProperty() {
        return price;
    }

    public void setPrice(double price) {
        this.price.set(price);
    }

    public double getDiscount() {
        return discount.get();
    }

    public SimpleDoubleProperty discountProperty() {
        return discount;
    }

    public void setDiscount(double discount) {
        this.discount.set(discount);
    }

    public double getQuantity() {
        return quantity.get();
    }

    public SimpleDoubleProperty quantityProperty() {
        return quantity;
    }

    public void setQuantity(double quantity) {
        this.quantity.set(quantity);
    }

    public Image getImage() {
        return image;
    }

    @Override
    public String toString() {
        return "{ \"product\":{ \"id\" : " + this.id + ",\"name\" : "  + this.name +
                ", \"price\" : " + this.price + ",\"image\" : " + "placeholder" + ",\"unit\" : " + this.unit +
                "\"discount\" : { \"percentage\" :" + this.discount + "} }, \"quantity\":" + this.quantity  +"}";

    }

    @Override
    public Image base64ToImageDecoder(String base64input) {
        byte[] decodedBytes = Base64.getMimeDecoder().decode(base64input.split(",")[1]);
        ByteArrayInputStream imageArr =  new ByteArrayInputStream(decodedBytes);
        return new Image(imageArr);
    }

    @Override
    public String imageToBase64Encoder(Image image) {
        BufferedImage bImage = SwingFXUtils.fromFXImage(image, null);
        ByteArrayOutputStream b = new ByteArrayOutputStream();
        String base64String = null;
        try {
            ImageIO.write(bImage, "png" , b);
            byte[] imageBytes = b.toByteArray();

            Base64.Encoder encoder = Base64.getEncoder();
            base64String = encoder.encodeToString(imageBytes);
            b.close();
        }
        catch (IOException e) {
            e.printStackTrace();
        }
        return base64String;
    }
}


